package main

import (
	"crypto/sha256"
	"fmt"
)

func hashData(data string) string {
	hash := sha256.New()
	hash.Write([]byte(data))
	return fmt.Sprintf("%x", hash.Sum(nil))
}

func main() {
	record := "eyJhbGciOiJFUzI1NksiLCJ0eXAiOiJKV1QifQ..mg1I8s56zQnKCAwZ31TwUYkcL8hE8zQAd_Vn6ieaey1prfBuGu1M2dv_bI2BY9xrlhgw5Eym8YbCSix3sWlgcAE"
	fmt.Println(hashData(record))
}

